import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and button to be available
    await page.waitForSelector('#searchInput');
    await page.waitForSelector('.search-btn');

    // Enter XSS payload in search input
    const xssPayload = '<script>alert("XSS")</script>';
    await page.fill('#searchInput', xssPayload);

    // Take screenshot after entering XSS payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_entered.png'));

    // Click search button to submit the form
    await page.click('.search-btn');
    await page.waitForLoadState('networkidle');
    await page.waitForTimeout(1000); // Wait for potential XSS execution

    // Take screenshot after submission
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_submission.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_submission.png'));

    // Check if XSS payload is reflected in the page
    const pageContent = await page.content();
    const xssDetected = pageContent.includes(xssPayload);

    return {
      success: true,
      action: "Attempted XSS via search input with payload: " + xssPayload,
      extractedData: {
        xssPayload: xssPayload,
        xssDetected: xssDetected,
        pageContentLength: pageContent.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete XSS attempt via search input",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
